import React, { Component } from 'react';

import './App.css';

class App extends Component {

  render() {
    const name = 'Will';
    const loading = true;
    if(loading){
      return <h4 className="">Loading...</h4>
    }
    return(
      <div className="App">
        <h1 className="">Hello From {name}!</h1>
      </div>
    )
  }
}

export default App;
